var data = 'data:image/jpeg;base64,';
var dataUriToBuffer = require('data-uri-to-buffer');
var bg = require('./index');

var wat = dataUriToBuffer(data)

bg(wat, function(err, butted) {
  if (err) console.log('err', err)
  var dataUri = 'data:' + wat.type + ';base64,' + butted.toString('base64');

  console.log(dataUri);
})